    isPrimitive: true
    uid: Int
  - name: b
    summary: Karşılaştırılacak ikinci değer.
    isPrimitive: true
    uid: Int
output:
  content: Bool
  types:
  - summary: yalnızca `a` `b`eşitse `true`.
    isPrimitive: true
    uid: Bool
